@eel.expose
def importProject():
	root = Tk() 
	root.geometry('0x0')

	filename = askopenfilename(initialdir = DIR_DEFAULT, 
									title = "Select a File", 
									filetypes = (("notet project files", 
													"*.notetproject*"), 
												("all files", 
													"*.*"))) 
	
	unpackProject({'name':filename, 'isImport':True})


@eel.expose
def createProject(projectName):

	global currentProjectName	
	global DIR_PROJECT
	global DIR_SOURCES

	os.chdir(DIR_PROJECTSFOLDER)

	try:
		os.mkdir(projectName)

	except:
		print(projectName, 'already exists!')


	if currentProjectName != None: ## We need to pack project if there is an opened one
		packProject() # No paramaters to packProject function means the currentProject will be packed because of switching new project

	# Opening the project
	""" Opening a project is actually setting all global variables towards to chosen project"""


	currentProjectName = projectName
	DIR_PROJECT = DIR_PROJECTSFOLDER + '/' + currentProjectName
	DIR_SOURCES = DIR_PROJECT + '/src' 

